import React, { useEffect, useState } from "react";
import axios from "axios";

function App1() {
  const [response, setResponse] = useState();

  useEffect(() => {
    const options = {
      method: 'GET',
      headers: {
        'X-RapidAPI-Key': 'e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6',
        'X-RapidAPI-Host': 'webknox-recipes.p.rapidapi.com'
      }
    };

    axios.get('https://webknox-recipes.p.rapidapi.com/recipes/quickAnswer?q=How%20much%20vitamin%20c%20is%20in%202%20apples%3F', options)
      .then(response => {
        setResponse(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div className="app">
      {response &&
        <div className="item-container">
          Answer: {response.answer}
        </div>
      }
    </div>
  );
}

export default App1;
